const styles = (theme) => ({
  radio: {
    padding: 4,
    margin: '-8px 4px -8px 0',
  },
  autocomplete: {
    marginTop: -17,
    width: '30%',

    '& .MuiInputBase-root': {
      height: 30,
      alignContent: 'center',
      marginRight: '50px',
    },
  },
  searchMaxWidth: {
    height: 30,
    width: '50% !important',
    maxWidth: '480px !important',
    justifyContent: 'flex-end !important',

    [theme.breakpoints.up('md')]: {
      maxWidth: '640px !important',
    },

    '& .MuiButtonBase-root': {
      maxHeight: '100%',
    },

    '& .MuiFormLabel-root': {
      fontSize: theme.typography.pxToRem(12),
      zIndex: 1,
    },
  },
  searchLeft: {
    marginLeft: '4px !important',
  },
});

export default styles;
